import React from 'react';
import Navbar from '../components/Navbar';
import Form from '../components/ContactForm';
import Footer from '../components/Footer';

export default function ContactPage() {

  return (
    <React.Fragment>

      <Navbar />
      <Navbar style={{position: "relative"}}/>
      <Form />
      <Footer />

    </React.Fragment>
  );
}
